def on_compile(application, object, action_name, context, objects):
	result=objects
	for xobject in object.get_objects_list():
		result.append({"object": xobject})
	return result

class VDOM_tree(VDOM_object):

	def render(self, parent, contents=""):

		woid = (self.id).replace('-', '_')
		id = 'o_' + woid

		if self.visible == "1":
			vis=""
		else:
			vis="display:none;"

		result = ""

		import StringIO
		resultIO = StringIO.StringIO()

		style=u"%s z-index: %s;position: %s;top: %spx;left: %spx;width: %spx;height: %spx; overflow: visible;"%(vis, self.zindex, self.position, self.top, self.left, self.width, self.height)

		resultIO.write(u"""
			<div objtype="tree" objname="%(oname)s" ver="2011.10.12" class='dynatreetype' style='%(style)s' id='%(id)s'> %(contents)s %(data)s""" % {
			"oname":    self.name,
			"style":    style,
			"id":       id,
			"contents": contents,
			"data" :    self.data
			}
		)

		result += resultIO.getvalue()
		resultIO.close()

		result_s = u"""</div>
